let formFeedBacks = document.querySelector("#formFeedBack"),
  formInputs = formFeedBacks.querySelectorAll(".inputs"),
  swiperCommentsFeedBacks = document.querySelector(
    "#homeFeedBacks .content .swiper .swiper-wrapper"
  ),
  currentId = 1,
  commentsFeedBacks = [
    {
      id: 1,
      UserName: "Mohamed Ayman(MA)",
      academicYear: "Second",
      message: `MA Library completely changed the way I study! The collection is vast, the interface is smooth, and I can access everything I need anytime, anywhere.`,
    },
  ],
  wrapperHome = document.querySelector("#homeFeedBacks .swiper-wrapper"),
  commentCard = document.createElement("div"),
  numberCardsEle = document.getElementById("total"),
  cards = document.querySelectorAll(".faq-card");

// Self Invoke
(async function () {
  commentCard.classList.add("swiper-slide", "wow", "animate__fadeIn");
  commentCard.dataset.wowDuration = ".5s";
  commentCard.dataset.wowDelay = "0s";

  if (localStorage.getItem("comments") != null) {
    commentsFeedBacks = JSON.parse(localStorage.getItem("comments"));
  } else {
    localStorage.setItem("comments", JSON.stringify(commentsFeedBacks));
  }

  if (localStorage.getItem("favoriteBooks") != null) {
    favoriteBooks = JSON.parse(localStorage.getItem("favoriteBooks"));
  } else {
    localStorage.setItem("favoriteBooks", JSON.stringify(favoriteBooks));
  }

  if (localStorage.getItem("idBooks") != null) {
    favoriteBooksNumber = JSON.parse(localStorage.getItem("idBooks"));
  } else {
    localStorage.setItem("idBooks", JSON.stringify(favoriteBooksNumber));
  }

  // check if Number currentId Of Students found any number ? if n't doesn't do any things
  if (localStorage.getItem("currentId") == null) {
    localStorage.setItem("currentId", currentId);
  } else {
    currentId = +localStorage.getItem("currentId");
  }

  showAllComments(commentsFeedBacks);
  numberCardsEle.textContent = swiper.slides.length;
})();

window.addEventListener("DOMContentLoaded", function () {
  this.setTimeout(() => {
    HomeHeader.classList.add("active");
  }, 200);
});

formFeedBacks.addEventListener("submit", function (e) {
  e.preventDefault();

  for (let input of formInputs) {
    checkInput(input);
  }
  for (let input of formInputs) {
    if (input.dataset.valid == "false") {
      return 0;
    }
  }
  let newComment = addCommentInObj(++currentId);
  commentsFeedBacks.push(newComment);
  addComment(commentsFeedBacks);

  this.reset();

  Swal.fire({
    icon: "success",
    title: "Comment Added!",
    text: "Your comment has been successfully added.",
    showConfirmButton: false,
    timer: 1200,
    iconColor: "#f3bc7ad0",
    color: "#fcdbb0",
    background: "#644013",
    timerProgressBar: true,
  });
});

for (let formInput of formInputs) {
  // if user getOut focus in any input do function
  formInput.addEventListener("blur", () => {
    checkInput(formInput);
  });
}

swiper.on("slideChange", function () {
  document.getElementById("current").textContent = swiper.realIndex + 1;
});

cards.forEach((card) => {
  card.addEventListener("click", function () {
    card.classList.toggle("flipped");
  });
});

